import React from 'react';
import './Styles.css';
import QuizContainer from './components/index';
import quizData from './components/quiz-data';
import { loadQuiz , deselectAnwser, getSelected } from './components/quiz-check';

const App = () => {
  return (
    <div>
      <QuizContainer />
      <quizData />
      <loadQuiz />
      <deselectAnwser />
      <getSelected />
    </div>
  );
}

export default App;
